export const getters = {
    alerts(state) {
        return state.alerts;
    },
    formats(state){
        return state.formats
    },
    settings(state){
        return state.environment.settings
    },
    distros(state){
        return state.environment.distros
    },
    currencyList(state){
        return state.currencyList
    },
    countryList(state){
        return state.countryList
    },
    countryStates(state){
        return state.countryStates
    },
    currencySymbol(state){
        return state.currencySymbol;
    }
};

export const mutations = {
    SET_ALERTS(state, alerts) {
        state.alerts = alerts;
    },
    SET_SETTINGS(state, settings) {
        state.environment.settings = settings;
    },
    SET_DISTROS(state, distros) {
        state.environment.distros = distros;
    }
};

export const actions = {
    async nuxtServerInit({ commit }, { req }) {
        await this.$axios.get('/env/variables').then((response)=>{
            commit('SET_SETTINGS', response.data);
        }).catch((e)=>{

        });
        await this.$axios.get('/env/distros').then((response)=>{
            commit('SET_DISTROS', response.data);
        }).catch((e)=>{

        });
    },
    setAlerts({ commit }, alerts) {
        commit('SET_ALERTS', alerts);
    },
    clearAlerts({ commit }) {
        commit('SET_ALERTS', {has: false});
    },
};



export default {
    state,
    getters,
    mutations,
    actions
}